import { useParams } from "react-router-dom";
import { useState, useEffect } from "react";

import FeedbackForm from "../pages/feedbackForm";
import Loading from "../components/loadingScreen";
import { getUserSettingsByApiKey } from "./databaseRoutes";

const ApiPrivateRoute = ({ children }) => {
    const { apiKey } = useParams();
    const [loading, setLoading] = useState(true);
    const [userExists, setUserExists] = useState(false);

    useEffect(() => {
        const checkUser = async () => {
            try {
                const user = await getUserSettingsByApiKey(apiKey);
                if (user) {
                    return <Loading />
                }
            } catch (error) {
                console.error("Error fetching user by API key:", error);
            } finally {
                setLoading(false);
            }
        };

        checkUser();
    }, [apiKey]);

    if (loading) {
        return <Loading />;
    }

    return <h1>Cannot find user</h1>;
};


export default ApiPrivateRoute;
